const Split1 = () =>{
    return (
            <div className="split1">
                <span></span>
                <p>Cliquez pour découvrir</p>
                <span></span>
            </div>
    );
};


const Menu_page_dev_item = () =>{
    return (
        <div className='menu_page_item'>
        <span></span>
        <p>Développement</p>
    </div>
    );

};


const Menu_page_son_item = () =>{
    return (
        <div className='menu_page_item'>
        <span></span>
        <p>Son</p>
    </div>
    );

};


const Menu_page_visuel_item = () =>{
    return (
        <div className='menu_page_item'>
        <span></span>
        <p>Visuel</p>
    </div>
    );

};




const Menu_page = () =>{

    useEffect(() => {
        const handleScroll = () => {
            const scrollY = window.scrollY; 
            const elements = document.querySelectorAll('.dev_item'); // Sélectionner les éléments

            elements.forEach((element, index) => {
                // Calcule une position X en fonction du scrollY
                const positionX = scrollY * (0.5 + index * 0.1); // Ex. : une vitesse différente pour chaque élément
                element.style.transform = `translateX(${positionX}px)`; // Applique la transformation
            });
        };

        // Ajouter l'événement de défilement
        window.addEventListener('scroll', handleScroll);
            // Nettoyage de l'événement lors du démontage du composant
            return () => {
                window.removeEventListener('scroll', handleScroll);
            };
        }, []);

    return (
        <div className="menu_page">
            <Split1/>
            <div className="carrousel dev_item">
                <Menu_page_dev_item/>
                <Menu_page_dev_item/>
                <Menu_page_dev_item/>
                <Menu_page_dev_item/>
                <Menu_page_dev_item/>
            </div>
            <span className="split2"></span>
            <div className="carrousel son_item">
                <Menu_page_son_item/>
                <Menu_page_son_item/>
                <Menu_page_son_item/>
                <Menu_page_son_item/>
                <Menu_page_son_item/>
                <Menu_page_son_item/>
                <Menu_page_son_item/>
                <Menu_page_son_item/>
                <Menu_page_son_item/>
                <Menu_page_son_item/>
                <Menu_page_son_item/>
            </div>
            <span className="split2"></span>
            <div className="carrousel visuel_item">
                <Menu_page_visuel_item/>
                <Menu_page_visuel_item/>
                <Menu_page_visuel_item/>
                <Menu_page_visuel_item/>
                <Menu_page_visuel_item/>
                <Menu_page_visuel_item/>
                <Menu_page_visuel_item/>
                <Menu_page_visuel_item/>
            </div>
            <Split1/>

        </div>
    );
};

export default Menu_page;
